import React, {Component} from 'react';
import './App.css';
import './dist/css/bootstrap.min.css';

class AppFooter extends Component {
    render() {
        return (
            <div className="App-footer navbar-dark bg-dark fixed-bottom">
                <a className="navbar-brand font-weight-bold">Copyright &copy; 2020 Adam Arthur Faizal. All Rights Reserved</a>
            </div>
        );
    }
}

export default AppFooter;
